INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<p>© Copyright 2014. Corporate X is a Premium Drupal Theme built by <a href="http://doublemthemes.com">DoubleMThemes</a>. You can find more info about it on <a href="http://demos.doublemthemes.com/corporatex3/documentation/">Corporate X Documentation</a>.<br />\r\n	Here you can just put all your Legal and Copyright info or just replace it with any additional information. This is just a sample website built for demos purposes where you can edit and change anything.<br />\r\n	All Demo images are properly licensed by <a href="http://photodune.net?ref=DoubleMThemes">Photodune.net</a> to DoubleMThemes for demo purposes and are not included in the downloadable package. Instead, gray blanked images will be found replacing all the ones you may see here.</p>\r\n', 'Corporate X - Copyright & Legal', 'full_html'),
(2, '<p>Here you can show any info.&nbsp;Nulla facilisi. Pellentesque venenatis dui in leo dictum facilisis. Duis a neque odio, at varius elit. Suspendisse tincidunt orci nec arcu semper imperdiet volutpat elit faucibus. Donec consectetur</p>\r\n<p>&nbsp;Duis a neque odio, at varius elit. Suspendisse tincidunt orci nec arcu semper&nbsp;ellentesque venenatis dui in leo dictum facilisis imperdiet volutpat elit faucibus. Donec consectetur</p>\r\n', 'Corporate X - Sample Sidebar Block', 'full_html'),
(3, '<div class="panel-group" id="accordionSidebar">\r\n	<div class="panel panel-default">\r\n		<div class="panel-heading">\r\n			<h4 class="panel-title">\r\n				<a class="accordion-toggle collapsed" data-parent="#accordion" data-toggle="collapse" href="#collapseOne">Step #1: Buy the theme</a></h4>\r\n		</div>\r\n		<div class="panel-collapse in" id="collapseOne" style="height: auto;">\r\n			<div class="panel-body">\r\n				Here you can explain your visitors how does your business process works.<br />\r\n				<br />\r\n				Food truck quinoa nesciunt laborum eiusmod. Brunch 3 wolf moon tempor, sunt aliqua put a bird on it squid single-origin coffee nulla assumenda shoreditch et.</div>\r\n		</div>\r\n	</div>\r\n	<div class="panel panel-default">\r\n		<div class="panel-heading">\r\n			<h4 class="panel-title">\r\n				<a class="accordion-toggle collapsed" data-parent="#accordion" data-toggle="collapse" href="#collapseTwo">Step #2: Install it on your server</a></h4>\r\n		</div>\r\n		<div class="panel-collapse collapse" id="collapseTwo" style="height: 0px;">\r\n			<div class="panel-body">\r\n				Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid. 3 wolf moon officia aute, non cupidatat skateboard dolor brunch. Food truck quinoa nesciunt laborum eiusmod. Brunch 3 wolf moon tempor, sunt aliqua put a bird on it squid single-origin coffee nulla assumenda shoreditch et.</div>\r\n		</div>\r\n	</div>\r\n	<div class="panel panel-default">\r\n		<div class="panel-heading">\r\n			<h4 class="panel-title">\r\n				<a class="accordion-toggle" data-parent="#accordion" data-toggle="collapse" href="#collapseThree">Step #3: Set up your store</a></h4>\r\n		</div>\r\n		<div class="panel-collapse in" id="collapseThree" style="height: 0px;">\r\n			<div class="panel-body">\r\n				Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid. 3 wolf moon officia aute, non cupidatat skateboard dolor brunch. Food truck quinoa nesciunt laborum eiusmod. Brunch 3 wolf moon tempor, sunt aliqua put a bird on it squid single-origin coffee nulla assumenda shoreditch et.</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n', 'Corporate X - Bootstrap Component Sample', 'full_html'),
(4, '<p>Praesent leo quam, faucibus at facilisis id, rhoncus sit amet metus. nam vel tristique dolor. sed quam magna, tincidunt ac fermentum eget,<br />\r\n	Rutrum non rhoncus sed, fringilla interdum urna.<br />\r\n	+556 5456 665532<br />\r\n	<a href="mailto:sample@email.com">sample@email.com</a></p>\r\n', 'Corporate X - About Us', 'filtered_html'),
(5, '<p>You can set up as many services as you want, all of them linked to projects as Taxonomy Terms. Aliquam erat volutpat. Praesent blandit venenatis mauris ac cursus. Etiam mollis mi vitae mi cursus elementum. Duis a elit lacus. Vestibulum quis accumsan arcu. Sed nec ipsum eu libero consequat convallis quis non lorem. In eget mauris sed lectus molestie porttitor ut ut quam. Nulla ipsum ante, hendrerit eget convallis vel, posuere vitae nisl.</p>\r\n', 'Corporate X - Services Intro', 'full_html'),
(6, '<p><span style="font-size: 12px;">Your products. projects, portfolio items or what ever you decide to showcase, can be easily grouped using the Service Taxonomy. Each Service or Projects Group will be arranged in the Taxonomy Term page. Nulla facilisi. Pellentesque venenatis dui in leo dictum facilisis. Duis a neque odio, at varius elit. Suspendisse tincidunt orci nec arcu semper imperdiet volutpat elit faucibus. Donec consectetur sapien non orci dapibus nec mollis eros imperdiet.</span></p>\r\n', 'Corporate X - Products Intro', 'full_html'),
(7, '<p>Aenean rhoncus lorem vel est ornare sed vestibulum orci porta. Aliquam erat volutpat. Praesent blandit venenatis mauris ac cursus. Etiam mollis mi vitae mi cursus elementum. Duis a elit lacus. Vestibulum quis accumsan arcu. Sed nec ipsum eu libero consequat convallis quis non lorem. In eget mauris sed lectus molestie porttitor ut ut quam. Nulla ipsum ante, hendrerit eget convallis vel, posuere vitae nisl.</p>\r\n<ul>\r\n	<li>\r\n		Aenean mollis augue vitae urna congue consequat.</li>\r\n	<li>\r\n		Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.</li>\r\n	<li>\r\n		Vestibulum luctus venenatis malesuada.</li>\r\n</ul>\r\n<p>Sed ullamcorper pulvinar urna, id pharetra arcu dictum sit amet. Praesent id mauris urna, et tristique lectus. Mauris mauris eros, lobortis sit amet cursus eu, venenatis eu tortor. Curabitur vel tempus ligula. Integer venenatis ultrices vulputate. Donec non leo quam, a pulvinar enim. In nibh augue, semper ut dictum eu, tincidunt ut lorem.</p>\r\n', 'Corporate X - Contact Intro', 'full_html');
